import classes from './Post.module.css';

const Post = () => {
        return (
         <div className={classes.Post}> 

            <div id='block' className={classes.block1}>
<img className={classes.prof} src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max'></img>
            <div  id="info" className={classes.info0}>Ne uchite sami route, this pipecc</div>
            </div>

            <div id='block' className={classes.block2}>
 <img className={classes.prof} src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max'></img>
            <div id="info" className={classes.info1}>Hi, how is it going?</div>
            </div>
        </div>
        );
}

export default Post;
